function sumsq(array) {
    var sum = 0;
    var i, iLen;
    for (i = 0, iLen = array.length; i < iLen; i++) {
        sum += array[i] * array[i];
    }
    return sum;
}
alert(sumsq([1, 2, 3, 4, 5])); // 55

function sumsq(array) {
    var sum = 0,
        i = array.length;
    while (i--) sum += Math.pow(array[i], 2);
    return sum;
}
alert(sumsq([1, 2, 3, 4, 5])); // 55

